import './App.css';
import HomePage from './home-page/HomePage';
import Navbar from './navbar/Navbar';
import RecipeCategory from './category/RecipeCategory';
import RecipePage from './recipe-page/RecipePage';
import SearchPage from './recipe-page/RecipePage';
import SignIn from './sign-in/SignIn';
import SignUp from './sign-up/SignUp';
import MyAccount from './my-account/MyAccount';
import RecipeForm from './recipe-form/RecipeForm';
import AdminPage from './admin-page/AdminPage';

import React from 'react';
import {Route, Routes, BrowserRouter as Router} from 'react-router-dom';
import RecipesContextProvider from './RecipesContext';
import UserContextProvider from './UserContext';





export default function App() {
  return (
    <BrowserRouter>
      {/* <Router> */}
      <div>
        <Navbar/>
        <Routes>
        <Routes path='/' exact element={<HomePage />} />
        <Route path='/category/:id' element={<RecipeCategory/>} />
        <Route path='/recipe/:id' element={<RecipePage/>} />
        <Route path='/search/:searchTerm' element={<SearchPage/>}/>
        <Route path='/sign-in' element={<SignIn/>} />
        <Route path='/sign-up' element={<SignUp/>} />
        <Route path='/my-account' element={<MyAccount/>} />
        <Route path='/recipe-form' element={<RecipeForm/>} />
        <Route path='/admin' element={<AdminPage/>} />
        </Routes>
      </div>
      {/* </Router> */}
    </BrowserRouter>


  );
}
